import React from "react";

export default function Section1({
  title,
  subtitle,
  dark,
  id,
  contact_text,
  img_src,
  pic1,
  pic2,
  pic3,
  pic4,
}) {
  return (
    <div className={"section1" + (dark ? " section1-dark" : "")}>
      <div className="section1-content" id={id}>
        <h1>{title}</h1>
        <img src={img_src} width="460"></img>
        <p className={"section1-text"} style={{ whiteSpace: "pre-line" }}>
          {subtitle}
          {"\n"}
          {contact_text}
        </p>
        <img
          className="icon"
          src={pic1}
          style={{ position: "absolute", top: "652px", right: 370 }}
          width="50px"
        ></img>
        <img
          className="icon"
          src={pic2}
          style={{ position: "absolute", top: "652px", right: 320 }}
          width="50px"
        ></img>
        <img
          className="icon"
          src={pic3}
          style={{ position: "absolute", top: "652px", right: 270 }}
          width="50px"
        ></img>
        <img
          className="icon"
          src={pic4}
          style={{ position: "absolute", top: "652px", right: 220 }}
          width="50px"
        ></img>
      </div>
    </div>
  );
}
